    require(
      account != address(0),
      "TokenPaymentSplitter: account is the zero address"
    );
    require(shares_ > 0, "TokenPaymentSplitter: shares are 0");
    require(
      _shares[account] == 0,
      "TokenPaymentSplitter: account already has shares"
